- input: "TEXT\x1CC00478172\x1C.TEXT\x1C\x1CF3A\x1CThe Committee uses 'best efforts'
    procedures to indentify all individuals that contributute in excess of $200 in
    an election cycle that comply with federal law. The Committee's original solicitation
    always includes a conspicuous and clear statement informing the contributor of
    the law's requirements for the collection and reporting of a contributor's full
    name, complete mailing address, occupation and name of employer. If the contributor
    does not provide sufficient reporting information when making a contribution within
    30 days of receipt of the contribution we make an effort to obtain this information
    either orally or in writing. The requests are made by letter, email and telephone
    calls to obtain this information. The request includes a clear statement of the
    federal law requiring the collection and reporting of contributor information,
    that this is not a solicitation for a contributionand it does not include material
    on any other subject. If the request is made by letter we include a pre-addressed
    stamped envelope, a fax number, telephone number and an email address for the
    contributor to respnd with the requested information. When oral requests are made
    it is documented in writing. Amended reports are filed when additional contributor
    information is received after the due date of the original report. \n"
